import React, { useState } from 'react';

const App = () => {
 
  const [fruit, setfruit] = useState('apple');

  const  changefruit = ()=>{

    setfruit('mango');

  };

  return(
    <>
<button onClick={changefruit}>
  click to show new fruit {fruit}
</button>
    </>
  ) ;
};

export default App;
